import { APIService } from "../APIService";
var apiService = new APIService();
export default {
  name: "newgroup",
  checkbox: false,
  data: function data() {
    return {
      valid: true,
      ruleForm1: {
        group_name: ""
      },
      namesRules: {
        group_name: [{
          required: true,
          message: "Name is required",
          trigger: "blur"
        }]
      }
    };
  },
  methods: {
    create: function create(formName) {
      var _this = this;

      this.$refs[formName].validate(function (valid) {
        if (valid) {
          var info = {
            group_name: _this.ruleForm1.group_name
          };
          apiService.newGroup(info).then(function (result) {
            if (result.data.success) {
              _this.$router.push({
                name: "group",
                params: {
                  id: result.data.uri
                }
              });
            }
          });
        }
      });
    }
  }
};
